    data set is based show the areal distribution of the major bottom sediment types
    covering the sea floor off Massachusetts between Cape Ann and Cape Cod. The maps
    were intended as a guide to the future mapping of gravel, sand, silt, and clay,
    and, because these sediments reflect the hydraulic conditions, they are also helpful
    for deducing the important sediment transport mechanisms.",nt"license_title":
